  commentId: P:Google.Cloud.Asset.V1.SearchAllIamPoliciesRequest.Query
  id: Query
  parent: Google.Cloud.Asset.V1.SearchAllIamPoliciesRequest
  langs:
  - csharp
  - vb
  name: Query
  nameWithType: SearchAllIamPoliciesRequest.Query
  fullName: Google.Cloud.Asset.V1.SearchAllIamPoliciesRequest.Query
  type: Property
  source:
    remote:
      path: apis/Google.Cloud.Asset.V1/Google.Cloud.Asset.V1/AssetService.g.cs
      branch: 4452d3ba8345dd6cf2976f10876e28bd3e2e48a0
      repo: git@github.com:googleapis/google-cloud-dotnet.git
    id: Query
    path: ../../../apis/Google.Cloud.Asset.V1/Google.Cloud.Asset.V1/AssetService.g.cs
    startLine: 6409
  assemblies:
  - Google.Cloud.Asset.V1
  namespace: Google.Cloud.Asset.V1
  summary: "\nOptional. The query statement. See [how to construct a\nquery](https://cloud.google.com/asset-inventory/docs/searching-iam-policies#how_to_construct_a_query)\nfor more information. If not specified or empty, it will search all the\nIAM policies within the specified `scope`. Note that the query string is\ncompared against each Cloud IAM policy binding, including its members,\nroles, and Cloud IAM conditions. The returned Cloud IAM policies will only\ncontain the bindings that match your query. To learn more about the IAM\npolicy structure, see [IAM policy\ndoc](https://cloud.google.com/iam/docs/policies#structure).\n\nExamples:\n\n* `policy:amy@gmail.com` to find IAM policy bindings that specify user\n&quot;amy@gmail.com&quot;.\n* `policy:roles/compute.admin` to find IAM policy bindings that specify\nthe Compute Admin role.\n* `policy:comp*` to find IAM policy bindings that contain &quot;comp&quot; as a\nprefix of any word in the binding.\n* `policy.role.permissions:storage.buckets.update` to find IAM policy\nbindings that specify a role containing &quot;storage.buckets.update&quot;\npermission. Note that if callers don&apos;t have `iam.roles.get` access to a\nrole&apos;s included permissions, policy bindings that specify this role will\nbe dropped from the search results.\n* `policy.role.permissions:upd*` to find IAM policy bindings that specify a\nrole containing &quot;upd&quot; as a prefix of any word in the role permission.\nNote that if callers don&apos;t have `iam.roles.get` access to a role&apos;s\nincluded permissions, policy bindings that specify this role will be\ndropped from the search results.\n* `resource:organizations/123456` to find IAM policy bindings\nthat are set on &quot;organizations/123456&quot;.\n* `resource=//cloudresourcemanager.googleapis.com/projects/myproject` to\nfind IAM policy bindings that are set on the project named &quot;myproject&quot;.\n* `Important` to find IAM policy bindings that contain &quot;Important&quot; as a\nword in any of the searchable fields (except for the included\npermissions).\n* `resource:(instance1 OR instance2) policy:amy` to find\nIAM policy bindings that are set on resources &quot;instance1&quot; or\n&quot;instance2&quot; and also specify user &quot;amy&quot;.\n"
  example: []
